import { Route, Routes } from 'react-router-dom';
import Nuj from './Teoria Culorilor/mainTeorie';
import Joc from './Joc/joc';
import Settings from './Settings/settings';
import Acasa from './Acasa/home';
import Lab from './Laborator/lab';
import Quiz from './Quizz-uri/quizMain'; // Verifică dacă acest import este corect

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/Acasa" element={<Acasa />} />
        <Route path="/joc" element={<Joc />} />
        <Route path="/teorie" element={<Nuj />} />
        <Route path="/laborator" element={<Lab />} />
        <Route path="/setari" element={<Settings />} />

        <Route path="/quiz/*" element={<Quiz />} />
      </Routes>
    </div>
  );
}

export default App;
